import Login from './Components/User/HomeLogin/Login'
export default class App extends React.Component {


    componentDidMount() {

        fetch('/timeline')
            .then(res => res.text())
            .then(res => res)
    }
    render() {

        return (
            <div className="App">
                <TimeLine />
                <OrderHistory />
            </div>
        );
    }
}
